{-# INLINE encodedScriptExtensions #-}
encodedScriptExtensions :: Char -> Int#
encodedScriptExtensions c
    -- Planes 0-3
    | cp < 0x323B0 = lookupEncodedScriptExtensionsBitMap cp#
    -- Planes 4-13: 163
    | cp < 0xE0000 = 163#
    -- Plane 14
    | cp < 0xE01F0 = lookupEncodedScriptExtensionsBitMap (cp# -# 0xADC50#)
    -- Default: 163
    | otherwise = 163#
    where
    !cp@(I# cp#) = ord c

